import React from 'react';
import Youtube from 'react-youtube';

export default function YoutubeChannel() {

    const opts = {
        height: '390',
        width: '640',
        playerVars: {
            autoplay: 1
        }
    };

    const onReady = (event) => {
        event.target.pauseVideo();
    }


    return (
        <div>
            <h1>YouTube</h1>
            <Youtube videoId="h-ssp_goKhpZEWPd" opts={opts} onReady={onReady}  />
        </div>
    )
}
